import React, { useEffect, useState } from 'react';
import axios from 'axios';

const LogAnalyzer = () => {
    const [logs, setLogs] = useState([]);

    useEffect(() => {
        axios.get('http://localhost:5000/api/logs')
            .then(res => setLogs(res.data))
            .catch(err => console.error("Error fetching logs:", err));
    }, []);

    return (
        <div>
            <table>
                <thead>
                    <tr>
                        <th>Timestamp</th>
                        <th>Source IP</th>
                        <th>Destination IP</th>
                        <th>Details</th>
                        <th>Status</th>
                    </tr>
                </thead>
                <tbody>
                    {logs.map((log, index) => (
                        <tr key={index} className={log.flagged ? 'flagged' : ''}>
                            <td>{log.timestamp}</td>
                            <td>{log.sourceIP}</td>
                            <td>{log.destinationIP}</td>
                            <td>{log.details}</td>
                            <td>{log.flagged ? ' Flagged' : ' Safe'}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
};

export default LogAnalyzer;
